SET UNIQUE_CHECKS = 1;

-- =====================================================
-- CLEANUP: REMOVE CARRIER COST RECOVERIES WITHOUT MATCHING ORDERS
-- =====================================================

-- Check how many carrier cost recoveries don't have matching orders
SELECT COUNT(*) as orphaned_recoveries_before_cleanup
FROM carrierCostRecoveries ccr
LEFT JOIN orders o ON ccr.consignmentId = o.consignmentId
WHERE o.consignmentId IS NULL;

-- Remove carrier cost recoveries that don't have matching orders
DELETE ccr FROM carrierCostRecoveries ccr
LEFT JOIN orders o ON ccr.consignmentId = o.consignmentId
WHERE o.consignmentId IS NULL;

-- Show how many records were deleted
SELECT ROW_COUNT() as recoveries_deleted;

-- Add foreign key constraint to prevent future orphaned records
-- Drop foreign key constraint if it exists (MySQL version compatible)
SET @constraint_exists = (SELECT COUNT(*) FROM INFORMATION_SCHEMA.KEY_COLUMN_USAGE WHERE TABLE_SCHEMA = 'Shipping' AND TABLE_NAME = 'carrierCostRecoveries' AND CONSTRAINT_NAME = 'fk_carrierCostRecoveries_consignmentId');
SET @sql = IF(@constraint_exists > 0, 'ALTER TABLE carrierCostRecoveries DROP FOREIGN KEY fk_carrierCostRecoveries_consignmentId', 'SELECT "Foreign key constraint does not exist" as message');
PREPARE stmt FROM @sql;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;
ALTER TABLE carrierCostRecoveries
ADD CONSTRAINT fk_carrierCostRecoveries_consignmentId
    FOREIGN KEY (consignmentId)
    REFERENCES orders(consignmentId)
    ON DELETE CASCADE
    ON UPDATE CASCADE;

-- Verify carrier cost recoveries count after cleanup
SELECT COUNT(*) as total_carrier_cost_recoveries_after_cleanup FROM carrierCostRecoveries;

-- Show recovery amount statistics
SELECT
    MIN(freightRecovery) as min_recovery,
    MAX(freightRecovery) as max_recovery,
    AVG(freightRecovery) as avg_recovery,
    SUM(freightRecovery) as total_recovery
FROM carrierCostRecoveries;
